        /* تصميم عام */
        body {

            background-color: #1e1e2f;
            color: #fff;
            margin: 0;
            padding: 0;
        }

        h1 {

        p {

        .profile-links {
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
            gap: 20px;
            padding: 20px;
        }

        .link-item {
            display: flex;
            flex-direction: column;
            align-items: center;
            background: #2a2a3b;
            border-radius: 15px;
            padding: 20px;
            width: 140px;
            text-align: center;
            transition: transform 0.3s, background 0.3s;
            cursor: pointer;
        }

        .link-item:hover {
            background: #3c3c5a;
            transform: scale(1.05);
        }

        .link-item img {
            width: 80px;
            height: 80px;
            margin-bottom: 10px;
            border-radius: 50%;
            border: 3px solid #fff;
            transition: transform 0.3s;
        }

        .link-item img:hover {
            transform: rotate(360deg);
        }

        .link-item a {
            color: #00d4ff;
            text-decoration: none;
            font-weight: bold;
            font-size: 14px;
            margin-top: 10px;
        }

        /* تصميم متجاوب */
        @media (max-width: 768px) {
            .link-item {
                width: 120px;
                padding: 15px;
            }

            .link-item img {
                width: 60px;
                height: 60px;
            }

            h1 {
                font-size: 28px;
            }

            p {
                font-size: 16px;
            }
        }
